import { Fragment } from 'react'
import Meta from './Meta'

type Props = {
  children: React.ReactNode
}

const Layout = ({ children }: Props) => {
  return (
    <Fragment>
      <Meta />
      <div style={{ backgroundColor: '#F6F9FB' }}>
        <main>{children}</main>
      </div>
    </Fragment>
  )
}

export default Layout
